import React from "react";
function Nav() {
  return (
    <div>
    <nav className="navbar navbar-expand-lg navbar-dark bg-primary">
        <Button variant="primary">Primary</Button>
      <a className="navbar-brand" href="/">
        React Reading List
      </a>
    </nav>
    </div>
  );
} 

export default Nav;
